import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function formatDate(dateString) {
    const date = new Date(dateString);
    let day = '' + date.getDate();
    let month = '' + (date.getMonth() + 1);
    let year = date.getFullYear();

    if (day.length < 2)
        day = '0' + day;
    if (month.length < 2)
        month = '0' + month;

    return [day, month, year.toString().substr(-2)].join('/');
}

function PopisLovaca() {
    const [lovci, setLovci] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        const config = {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        };

        axios.get('http://localhost:3000/popis-lovaca', config)
            .then(response => {
                if (response.data.error) {
                    console.error('Failed to fetch hunters:', response.data.message);
                    alert('Error: ' + response.data.message);
                } else {
                    // Map each lovci datum_rodjenja to formatted date
                    const formattedLovci = response.data.data.map(lovac => ({
                        ...lovac,
                        datum_rodjenja: formatDate(lovac.datum_rodjenja)
                    }));
                    setLovci(formattedLovci);
                }
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }, []);

    const handleDelete = (broj_lovacke_iskaznice) => {
        const confirmDelete = window.confirm("Da li stvarno Å¾elite izbrisati lovca?");
        if (confirmDelete) {
            const token = localStorage.getItem('token');
            const config = {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            };

            axios.delete(`http://localhost:3000/lovac-brisi/${broj_lovacke_iskaznice}`, config)
                .then(response => {
                    if (response.data.error) {
                        console.error('Error deleting hunter:', response.data.message);
                        alert('Error deleting hunter: ' + response.data.message);
                    } else {
                        setLovci(prevLovci => prevLovci.filter(lovac => lovac.broj_lovacke_iskaznice !== broj_lovacke_iskaznice));
                        console.log("Deleted successfully");
                    }
                })
                .catch(error => {
                    console.error('Error deleting hunter:', error);
                    alert('Error deleting hunter');
                });
        }
    };

    const buttonStyle = {
        padding: '10px 20px',
        fontSize: '16px',
        color: 'white',
        backgroundColor: '#007BFF',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
        marginRight: '10px'
    };

    const deleteButtonStyle = {
        ...buttonStyle,
        backgroundColor: '#FF6347'
    };

    const tableStyle = {
        width: '100%',
        borderCollapse: 'separate',
        borderSpacing: '0',
        boxShadow: '0 4px 8px rgba(0,0,0,0.15)',
        backgroundColor: '#f7f7f7',
        borderRadius: '10px',
        overflow: 'hidden'
    };

    const thTdStyle = {
        border: '1px solid #ddd',
        padding: '12px 15px',
        textAlign: 'left',
        fontSize: '14px',
        ':hover': {
            backgroundColor: '#f1f1f1'
        }
    };

    return (
        <div style={{ padding: '20px', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#eee' }}>
            <button onClick={() => navigate('/unos-lovca')} style={buttonStyle}>
                Unesi lovca
            </button>
            <div>
                <h1>Popis Lovaca</h1>
                <table style={tableStyle}>
                    <thead style={thTdStyle}>
                        <tr>
                            <th>Broj iskaznice</th>
                            <th>Ime</th>
                            <th>Prezime</th>
                            <th>Adresa</th>
                            <th>Datum roÄenja</th>
                            <th>Kontakt</th>
                            <th>Uloga</th>
                            <th>Akcije</th>
                        </tr>
                    </thead>
                    <tbody>
                        {lovci.map((lovac) => (
                            <tr key={lovac.broj_lovacke_iskaznice} style={{ ':hover': { backgroundColor: '#f9f9f9' } }}>
                                <td>{lovac.broj_lovacke_iskaznice}</td>
                                <td>{lovac.ime}</td>
                                <td>{lovac.prezime}</td>
                                <td>{lovac.adresa}</td>
                                <td>{lovac.datum_rodjenja}</td>
                                <td>{lovac.kontakt}</td>
                                <td>{lovac.uloga}</td>
                                <td>
                                    <button onClick={() => navigate('/a-lovac', { state: { lov: lovac } })} style={buttonStyle}>
                                        AÅ¾uriraj
                                    </button>
                                    <button onClick={() => handleDelete(lovac.broj_lovacke_iskaznice)} style={deleteButtonStyle}>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
            <br></br>
            <button onClick={() => navigate('/glavni-izbornik')} style={buttonStyle}>
                Odustani
            </button>
        </div>
    );
}

export default PopisLovaca;
